<h3 id="_1-2-安装-ide" tabindex="-1"><a class="header-anchor" href="#_1-2-安装-ide" aria-hidden="true">#</a> <strong>1.2 安装 IDE</strong></h3>
<ol>
<li>请在 <a href="https://www.jetbrains.com/idea/" target="_blank" rel="noopener noreferrer">JenBrains 官网</a> 下载安装 IntelliJ IDEA</li>
<li>本地执行安装文件，安装 IDEA</li>
<li>菜单栏 File &gt; Setting 打开设置， Editor &gt; Code Style &gt; Line separator (for new lines): Unix and OS X (n)</li>
<li>确保 IDEA 使用 UTF-8 编码</li>
<li>安装 Lombok 插件，在 File &gt; Settings &gt; Plugins 中，搜索 Lombok，点击 Install 安装，并重启软件加载插件</li>
</ol>
<h3 id="_1-3-安装-git" tabindex="-1"><a class="header-anchor" href="#_1-3-安装-git" aria-hidden="true">#</a> <strong>1.3 安装 Git</strong></h3>
<ol>
<li>请在 <a href="https://git-scm.com/download/" target="_blank" rel="noopener noreferrer">Git 官网</a> 下载相应版本的 Git。</li>
<li>本地执行安装文件，安装 Git 环境。</li>
<li>打开 Windows 命令行终端，执行如下命令，有相应的版本提示则表示 Git 安装成功
$ git --version</li>
</ol>
<ul>
<li><em>对于<strong>Windows</strong>，安装<strong>Git</strong>以后，你可以在任意目录右键，选择<strong>Git Bash Here</strong>。</em></li>
<li><em>打开的<strong>MINGW</strong>命令窗口可以执行兼容<strong>linux</strong>系统的命令。</em></li>
</ul>
<ol start="4">
<li>配置本地 git:</li>
</ol>
<div class="language-bash ext-sh line-numbers-mode"><pre v-pre class="language-bash"><code># 请将下面命令按实际情况进行执行
git config --global user.name &quot;Your Name&quot;
git config --global user.email &quot;Your Email&quot;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="_1-4-安装-sourcetree" tabindex="-1"><a class="header-anchor" href="#_1-4-安装-sourcetree" aria-hidden="true">#</a> <strong>1.4 安装 Sourcetree</strong></h3>
