<h2 id="_2-maven-私有仓库配置" tabindex="-1"><a class="header-anchor" href="#_2-maven-私有仓库配置" aria-hidden="true">#</a> <strong>2. maven 私有仓库配置</strong></h2>
<p>在项目中，依赖的 jar 包是从仓库中下载，所以您需要在 C:\Users{用户名}.m2\ 目录下 maven 配置文件 settings.xml。该文件中需包含 eos 私有仓库地址。</p>
<div class="language-xml ext-xml line-numbers-mode"><pre v-pre class="language-xml"><code>&lt;mirror&gt;
&lt;id&gt;eosmaven&lt;/id&gt;
&lt;mirrorOf&gt;central&lt;/mirrorOf&gt;
&lt;name&gt;eos maven&lt;/name&gt;
&lt;url&gt;http://maven.eos.h3c.com/repository/maven-public/&lt;/url&gt;
&lt;/mirror&gt;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><a href="https://www.yuque.com/attachments/yuque/0/2022/xml/22444450/1647483241819-1ff56991-f0d3-45e7-a0d4-ceb750c4b3f5.xml" target="_blank" rel="noopener noreferrer">📎settings.xml</a></p>
